import setClassIncorrectUser from '../../../common/untils/setClassIncorrectUser';
import postChangePasswordRequest from '../api/post/postChangePasswordRequest';

const processResultLoginForgetPassword = async (
  clientEmail, passwordNew, passwordNewRepeat, history,
) => {
  const result = await postChangePasswordRequest(clientEmail, passwordNew, passwordNewRepeat);
  if (result === true) {
    history.push('/main-page');
  } if (result === 'incorrectUserOrPassword') {
    setClassIncorrectUser('notRealUser', 'userNotFoundBlock');
  }
};

export default processResultLoginForgetPassword;
